import React, { useState } from 'react';
import { Container, Row, Col, Button } from 'react-bootstrap';
import Datetime from 'react-datetime-picker';
import 'react-datetime-picker/dist/entry.nostyle';

export function BookingForm() {
    const [checkIn, setCheckIn] = useState(new Date());
    const [checkOut, setCheckOut] = useState(new Date());

    function handleSubmit(e: React.FormEvent) {
        e.preventDefault();
        console.log('Form submitted');
    }

    return (
        <div className="container-fluid booking pb-5 wow fadeIn" data-wow-delay="0.1s">
            <div className={"container"}>
                <div className="bg-white shadow" style={{ padding: '35px' }}>
                    <div className="row g-2">
                        <div className="col-md-10">
                            <div className="row g-2">
                                <div className="col-md-3">
                                    <Datetime
                                        // id="date1"
                                        value={checkIn}
                                        onChange={setCheckIn}
                                        className="form-control"
                                        dayPlaceholder="Check in"
                                    />
                                </div>
                                <div className="col-md-3">
                                    <Datetime
                                        // id="date2"
                                        value={checkOut}
                                        onChange={setCheckOut}
                                        className="form-control"
                                        dayPlaceholder="Check out"
                                    />
                                </div>
                            </div>
                        </div>
                        <div className="col-md-2">
                            <Button variant="primary" onClick={handleSubmit} className="btn btn-primary w-100">
                                Submit
                            </Button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
